use ecomerce;
go
CREATE TABLE user (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name varchar(255) not NULL,
  dob DATE not null, 
  phone_number varchar(255),
  email VARCHAR(255) NOT NULL,
  password VARCHAR(255) NOT NULL,
  active BOOL,
  created_at DATETIME
);
go
go

delete 
from user
where email in (
select email 
from (
	select
			email,
			count(1) as count
	from user
	group by email 
	having count(1)>1
) ctas1);
go
commit;

go
alter table user ADD CONSTRAINT email_unique UNIQUE (email);
